package javaprg;

public class _11ExplicitTypeCast {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=10;
		byte b=(byte)a;
		System.out.println(b);
		
		int c=98;
		char d=(char)c;
		System.out.println(d);
		
		int e=130;
		byte f=(byte)e;
		System.out.println(f);
		
		int g=613;
		byte h=(byte)g;
		char i=(char)h;
		System.out.println(i);

	}

}
